import React from "react";

const nav__links = [
  {
    path: "#home",
    display: "Home",
  },
  {
    path: "#about",
    display: "About",
  },
  {
    path: "#service",
    display: "Service",
  },
  {
    path: "#projects",
    display: "Projects",
  },
  {
    path: "#blog",
    display: "Blog",
  },
];

const Header = () => {
  return (
    <header className="header">
      <div className="container">
        <div className="nav__wrapper">
          <div className="logo">
            <h2>E-D-I CONSEIL</h2>
            <p>Grow with us</p>
          </div>

          {/* --------- navigation --------- */}

          <div className="navigation">
            <ul className="menu">
              {nav__links.map((item, index) => (
                <li className="menu__item">
                  <a href={item.path} className="menu__link">
                    {item.display}
                  </a>
                </li>
              ))}
            </ul>
          </div>

          {/* --------- light mode --------- */}
          <div className="light__mode">
            <span>
              <i class="ri-sun-line"></i>Light Mode
            </span>
          </div>

        </div>
      </div>
    </header>
  );
};

export default Header;
